import '../styles/App.css';

const Exhibits = () => {
  return (
    <main className="exhibits-container">
      <h1>Exhibitions</h1>

      <div className="exhibit-item">
        <h2>Exhibition Title</h2>
        <p className="exhibit-date">Month Day - Month Day, Year</p>
        <p className="exhibit-location">Gallery Name, City, Country</p>
        <p className="exhibit-description">Brief description of the exhibition.</p>
      </div>

      <div className="exhibit-item">
        <h2>Exhibition Title</h2>
        <p className="exhibit-date">Month Day - Month Day, Year</p>
        <p className="exhibit-location">Gallery Name, City, Country</p>
        <p className="exhibit-description">Brief description of the exhibition.</p>
      </div>

      {/* Add more exhibition items as needed */}
    </main>
  );
};

export default Exhibits;
